import {fetchLogin} from "../helpers/axios"
export const LOGIN_REQUEST = 'LOGIN_REQUEST'


export const login =(email,password)=> async (dispatch) =>{
    try{
        const res=await fetchLogin (email,password);
        dispatch ({
            type:LOGIN_REQUEST,
            payload:res.data
        })
        console.log("payload")
    }
    catch (error) {
              console.log(error);
             }
}
